import React from 'react';
import Card from './Cards';
import Sdata from './Sdata';

function App(){
    return(
        <>
            <Card 
                imgSrc = {Sdata[0].imgSrc}
                title = {Sdata[0].title}
                Sname = {Sdata[0].Sname}
                link = {Sdata[0].link}
            />
            <Card 
                imgSrc = {Sdata[1].imgSrc}
                title = {Sdata[1].title}
                Sname = {Sdata[1].Sname}
                link = {Sdata[1].link}
            />
            <Card 
                imgSrc = {Sdata[2].imgSrc}
                title = {Sdata[2].title}
                Sname = {Sdata[2].Sname}
                link = {Sdata[2].link}
            />
            <Card 
                imgSrc = {Sdata[3].imgSrc}
                title = {Sdata[3].title}
                Sname = {Sdata[3].Sname}
                link = {Sdata[3].link}
            />
            <Card 
                imgSrc = {Sdata[4].imgSrc}
                title = {Sdata[4].title}
                Sname = {Sdata[4].Sname}
                link = {Sdata[4].link}
            />
        </>
    );
}

export default App;
